function timestr_to_timestamp(time_str){
    return parseInt(Date.parse(time_str) / 1000);
}

function get_start_timestamp(_time, _end){
    var _start = 0;
    if(_time == 'one_hour'){
        _start = _end - 3600;
    }
    else if(_time == 'six_hour'){
        _start = _end - 3600 * 6;
    }
    else if(_time == 'one_day'){
        _start = _end - 3600 * 24;
    }
    else if(_time == 'one_week'){
        _start = _end - 3600 * 24 * 7;
    }
    else if(_time == 'two_week'){
        _start = _end - 3600 * 24 * 14;
    }
    else if(_time == 'one_month'){
        _start = _end - 3600 * 24 * 30;
    }
    return _start;
}


